import React from "react";


function SearchBar(){

    return(
        <section id="searchbar">
            <input type="text" className=" rounded w-1/4 shadow-md "/>
            <input type="button" className="rounded "><i className="fas fa-plus-square bg-red-800"/></input>


        </section>
)


}



export default SearchBar;
